    <div className="App">
      <div class='container'>
        <form>
            <div class='form-group'>
                <input 
                  type='text' 
                  className='input-control mt-10' 
                  placeholder='search for books' 
                  autoComplete='off' />
            </div>
            <button 
              type='submit' className='btn btn-danger'>Search</button>
        </form>
      </div>
    </div>
  );
}

export default App;
